$concatArrays with $map ignores $concatArrays<p>I'm having a problem understanding why the following is producing illogical results.<br>
We know that <code>$concatArrays</code> takes in an array of arrays, and returns the content of each in one single array.<br>
We know that <code>$map</code> takes in an array and transforms the elements to something else which result in a new array modified to one function.</p>

<p>My problem occurs when combining <code>$concatArrays</code> of a <code>$map</code>. Take this for example:</p>

<pre><code>db.product.aggregate([
        {$replaceRoot: 
            {newRoot: {
                "_id":       "$_id",
                "availablesizes": 
                    {$concatArrays: {$map: {
                        "input": [[1],[2],[3]],
                        "in":    "$$this",
                    }},
            },
        },
    }},
]);
</code></pre>

<p>For the sake of testing, I replaced the variable array "input" with a static one of similar structure.  </p>

<p>Evaluating logically ... <code>$map</code> stage is going to return <code>[[1],[2],[3]]</code> literally, since each element is returned as is. Then <code>$concatArrays</code> should return <code>[1, 2, 3]</code> as it flattens the array.<br>
<strong>BUT</strong> the actual result is <code>[[1],[2],[3]]</code> !!</p>

<p><strong>If I remove <code>$concatArrays</code>, the result stays the same</strong>: </p>

<pre><code>db.product.aggregate([
        {$replaceRoot: 
            {newRoot: {
                "_id":       "$_id",
                "availablesizes": 
                {$map: {
                        "input": [[1],[2],[3]],
                        "in":    "$$this",
                },
            },
        },
    }},
]);
</code></pre>

