Filter query on array of embedded documents(3 levels) in mongoDb<p>I have a collection of diagrams. Each diagram has several blocks. And each block is having several ports, which in itself has multiple objects as fields.
So far i am only able to apply <code>$filter</code> or <code>$group</code> up to level 1 on blocks. I am unable to filter up to ports based on some condition.</p>

<p>The document structure is: Diagram</p>

<pre><code>[
  {
    "_id": "1",
    "blocks": [
      {
        "port": [
          {
            "portType": {
              "function": "input"
            }
          }
        ]
      }
    ]
  }
]
</code></pre>

<p>What i am trying to achieve is to get a list of all ports which have <code>input</code> as <code>portType.function</code> from the collection</p>

<pre><code>db.collection.aggregate([{$project:{"blocks.ports":{$filter:{input:"$blocks.ports",as:"ports",cond:{$in:["input","$$ports.portType.function"]}}}}}]);
</code></pre>

<p>Expected output : <code>list&lt;Ports&gt;</code> which have only <code>portType.function</code> as input.</p>

<p>Actual output: Returns all the documents which have at least one port as "input" along with all the other ports as well.</p>

