Mongodb: is possible to returning other value from array with project using `$ne`?<p>Can mongo <code>$ne</code> return value in <code>$project</code> instead of <code>true</code> or <code>false</code> ?</p>

<p>The documents :</p>

<pre><code>{
    "_id" : ObjectId("5d1449db6f934a2926c175d1"),
    "clients" : [ 
        "82", 
        "85"
    ],
    "roomId" : 1,
    "message" : [ 
        {
            "time" : ISODate("2019-06-27T04:44:49.528Z"),
            "status" : "SEND",
            "text" : "Ellorad",
            "sender" : "82",
            "reciever" : "82",
            "_id" : ObjectId("5d1449db6f934a2926c175d2")
        }, 
        {
            "time" : ISODate("2019-06-27T04:44:49.528Z"),
            "status" : "SEND",
            "text" : "helas veronaaah",
            "sender" : "82",
            "reciever" : "85",
            "_id" : ObjectId("5d1449ff6f934a2926c175d3")
        }
    ]
}
</code></pre>

<p>What I tried : </p>

<pre><code>    Chat.aggregate([
      { $match: { clients: 82 } },
      {
        $project: {
          _id: '$roomId',
          receiver: { $ne: ['$clients', 82] },
          message: { $slice: ['$message', -1] }
        }
      }
    ])
</code></pre>

<p>The result :</p>

<pre><code>{
  "message": [
    {
      "_id": 1,
      "receiver": true
      "message": [
        {
          "time": "2019-06-27T04:44:49.528Z",
          "status": "SEND",
          "text": "helas veronaaah",
          "sender": "82",
          "reciever": "85",
          "_id": "5d1449ff6f934a2926c175d3"
        }
      ]
    }
  ]
}
</code></pre>

<p>So the receiver just returning true or false here, which is right considering its <code>$ne</code>, but the result that I want is, the receiver here to be '85' not <code>true</code> or <code>false</code></p>

