<pre><code>{ "user" : [ { "post_id" : NumberLong(1) } ] }
{ "user" : [ { "post_id" : NumberLong(2) } ] }
{ "user" : [ { "post_id" : NumberLong(4) } ] }
{ "user" : [ { "post_id" : NumberLong(5) } ] }
</code></pre>

<p><strong>Even Better</strong></p>

<p><code>{ "user" : [ 1, 2, 4, 5 }] }</code></p>

<p>How can I modify aggregate query?</p>

<p>Thanks.</p>

