Nodejs with koa and Mongo - MongooseError: You can not `mongoose.connect()` multiple times while connected<p>I have an application in a aws machine in nodejs with koa and this application connects with a mongodb on a different aws machine. The error I am getting is <code>MongooseError: You can not</code>mongoose.connect()<code>multiple times while connected.</code> I am also running the application with pm2 </p>

<p>this is the code to connect to the db:</p>

<pre><code>    const mongoose = require('mongoose');
const { transform } = require('koa-bootstrap-service/lib/plugins');
const url = require('url');

const config = require('../../config/index');

mongoose.Promise = Promise;

function makeMongoUrl() {
    const dbSettings = config.mongoDb;
    if (!dbSettings) {
        return false;
    }

    if (dbSettings.url) {
        return dbSettings.url;
    }

    const urlObj = {
        hostname: dbSettings.host,
        port: dbSettings.port,
        pathname: `/${dbSettings.db}`,
        query: dbSettings.options,
        protocol: 'mongodb',
        slashes: true,
    };
    if (dbSettings.username) {
        urlObj.auth = `${dbSettings.username}:${dbSettings.password || ''}`;
    }
    return url.format(urlObj);
}

function connectMongoDb() {
    mongoose.plugin(transform.middleware());
    mongoose
        .connect(makeMongoUrl(), {
            useNewUrlParser: true,
            useCreateIndex: true,
            useFindAndModify: false,
            keepAlive: 1,
            connectTimeoutMS: 30000,
            reconnectTries: 30,
        })
        .then(() =&gt; {
            global.Logger.debug('Mongoose Connected');
        })
        .catch(({ stack }) =&gt; {
            global.Logger.error(stack);
            process.exit(0);
        });
}

connectMongoDb();
</code></pre>

